    { id: Math.random().toString(), title: ('Breakfast'), description: t('text3'), price: t('price'), imgUrl: '3.png' },
    { id: Math.random().toString(), title: ('Dinner'), description: t('text2'), price: t('price'), imgUrl: '2.png' },
